INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 1, 0, 2, 0, 1001, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 1, 0, 2, 0, 1002, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "士条 怜", "少しは磨かれると思いますよ。", 0, 0, 1, 0, 2, 0, 1003, 1, 0, "フェンシングを始めてみては？", "キミに必要な集中力と感性が");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 1, 0, 2, 0, 1004, 1, 0, "ねぇ、にいちゃん！", "今日はなにして遊ぶ？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "風宮 あかり", "私といっしょに…\nいかない？", 0, 0, 1, 0, 2, 0, 1006, 1, 0, "風宮あかりです", "ねぇ…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "出雲 宮子", "食べ物の恨みは怖いのー", 0, 0, 1, 0, 2, 0, 1007, 1, 0, "出雲宮子なのー", "プリンたべたいのー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "虹村 雪", "いいよ。\n見られることは運命さ…", 0, 0, 1, 0, 2, 0, 1008, 1, 0, "ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "柊杏奈", "人呼んで「疾風の冥姫」!!", 0, 0, 1, 0, 2, 0, 1009, 1, 0, "フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "姫宮 真歩", "ほんまおおきにやわ～♪", 0, 0, 1, 0, 2, 0, 1010, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "衣之咲 璃乃", "ここで会ったが\n100年目～！", 0, 0, 1, 0, 2, 0, 1011, 1, 0, "衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 1, 0, 2, 0, 1012, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 1, 0, 2, 0, 1016, 1, 0, "ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "喜屋武 香織", "でも、沖縄もとってもいいとこさー", 0, 0, 1, 0, 2, 0, 1017, 1, 0, "はいたーい。\n喜屋武香織さー。", "東京は遊園地みたいなところさー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "支倉 伊緒", "イオちゃんって呼んでね。", 0, 0, 1, 0, 2, 0, 1018, 1, 0, "支倉伊緒です。", "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "茜 ミミ", "ミミをおいてかないでぇ～", 0, 0, 1, 0, 2, 0, 1020, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "栗林 くるみ", "ふぇぇぇぇぇん……", 0, 0, 1, 0, 2, 0, 1021, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "風宮 より", "なんてありがとうございます！", 0, 0, 1, 0, 2, 0, 1022, 1, 0, "風宮よりです。\nあああああ！", "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "北条 綾音", "私こっち行きたいー\nね、早く早くー", 0, 0, 1, 0, 2, 0, 1023, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "天野 すずめ", "これて何か違う…\nあああすみません！", 0, 0, 1, 0, 2, 0, 1025, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "倉石 恵理子", "離しませんわ………\n絶対に…!!", 0, 0, 1, 0, 2, 0, 1027, 1, 0, "……クスクス…私は\n…倉石恵理子……", "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "佐々木 咲恋", "…そうでしょ？？", 0, 0, 1, 0, 2, 0, 1028, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "桜井 望", "あはは、\n私もまだまだだなぁ～", 0, 0, 1, 0, 2, 0, 1029, 1, 0, "桜井望だよ！\nよろしくねっ", "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 1, 0, 2, 0, 1030, 1, 0, "デケデケデンっ！", "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "上喜 しのぶ", "おかしいですね……", 0, 0, 1, 0, 2, 0, 1031, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 1, 0, 2, 0, 1033, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", "けんども\nそれには足りないモンが…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", 0, 0, 1, 0, 2, 0, 1034, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょっと緊張しちゃって…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "氷川 鏡華", "これ以上お話しすることは…\nないです！", 0, 0, 1, 0, 2, 0, 1036, 1, 0, "氷川鏡華…です", "知らない人とは話しちゃいけないので");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 1, 0, 2, 0, 1038, 1, 0, "柏崎…栞です。", "……あ、アラーム。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "双葉 碧", "野に咲く花が、\n唯一の話相手です。", 0, 0, 1, 0, 2, 0, 1040, 1, 0, "ふ、双葉碧です。", "私、一人も友達がいなくて……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "三角 千歌", "そう思っています。", 0, 0, 1, 0, 2, 0, 1042, 1, 0, "三角千歌です。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "安芸 真琴", "う、疑ってすまなかったな…", 0, 0, 1, 0, 2, 0, 1043, 1, 0, "安芸真琴だ。", "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 1, 0, 2, 0, 1044, 1, 0, "わらわこそは夜を総べる者！", "生けとし生ける全ての者よ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "遠見 空花", "ｌク、クウカに何かご用ですか!?", 0, 0, 1, 0, 2, 0, 1045, 1, 0, "そこで騎士は妖精を乱暴に……", "ぐふふふふ……はっ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 1, 0, 2, 0, 1046, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 1, 0, 2, 0, 1048, 1, 0, "大神美冬よ！", "それでは早速クエストに…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 1, 0, 2, 0, 1049, 1, 0, "星野静流だよ！", "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 1, 0, 2, 0, 1050, 1, 0, "アタシは玉泉美咲。", "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 1, "リマ", "？？？？", 0, 0, 1, 0, 2, 0, 1052, 1, 0, "？？？", "？？？？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "モニカ・ヴァイスヴィント", "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 0, 2, 0, 1053, 1, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "ペコリーヌ", "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 0, 2, 0, 1058, 1, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "コッコロ", "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 0, 2, 0, 1059, 1, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 1, "キャル", "そ、そこまでいうなら\nもらってやる", 0, 0, 1, 0, 2, 0, 1060, 1, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……");
